import React, { Component } from 'react';
import './App.css';
import {Route} from 'react-router-dom';
import BookmarkList from '../BookmarkList/BookmarkList'
import axios from 'axios'

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      bookmark: null
    }
  }
  componentDidMount() {
    axios.get('/api/bookmarks')
    .then((res) => {
        console.log(res)
        this.setState({
          bookmarks: res.data
        })
      })
      .catch((err) => {
        console.log(err)
      })
  }
  render() {
    return <div className="App"> 
          <Route  path= "/" exact component={App} />
          {/* // render={(routerProps) => <BookmarkList bookmarks={this.state.bookmarks} {...routerProps} {...this.state}/>}/>  */}

        </div> 

  }
}

export default App;
